import React from 'react';
import { Box, Button, Grid, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, TextField, Typography } from '@mui/material';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Create() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    Username: '',
    ConfirmUsername: '',
    Password: '',
    ConfirmPassword: ''
  });

  const validateField = (fieldName, value) => {
    let error = '';

    if (fieldName === 'email') {
      if ((!emailRegex.test(value) || value.length > 50) && value.trim() !== '') {
        error = 'Usernames do not match!';
      }
    }

    if (fieldName === 'firstName') {
      if (value.length > 25 && value.trim() !== '') {
        error = 'Passwords do not match!';
      }
    }

    setErrors((prevErrors) => ({
      ...prevErrors,
      [fieldName]: error,
    }));
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
    validateField(name, value);
  };

  const resetSuccess = () => {
    if (isFormValid()) {
      setSubmitted(false);
    }
  };
  

  return (
    <div>
      <header>
        <Typography variant="h4" component="h1" gutterBottom style={{ textAlign: 'center', marginTop: '20px' }}>
          Admin Dashboard
        </Typography>
        <Button variant="contained" style={{ backgroundColor: 'green', display: 'block', margin: '0 auto' }} onClick={() => navigate(-1)}>Back</Button>
      </header>
      <Grid container spacing={2} style={{ marginTop: '20px' }}>
        <Grid item xs={6} display="flex" justifyContent="center">

          <Box width="50%">
            <TextField 
                label="Username" 
                variant="outlined" 
                fullWidth margin="normal"
                value={formData.Username}
                onChange={handleChange}
                onFocus={resetSuccess}
                required
                
            />
            <TextField 
                label="ConfirmUsername" 
                variant="outlined" 
                fullWidth margin="normal"
                value={formData.ConfirmUsername}
                onChange={handleChange}
                onFocus={resetSuccess}
                required 
            />

            <TextField 
                label="Password" 
                type="password" variant="outlined"
                fullWidth margin="normal" 
                value={formData.Password}
                onChange={handleChange}
                onFocus={resetSuccess}
                required 
            />

            <TextField 
                label="ConfirmPassword" 
                type="password" 
                variant="outlined" 
                fullWidth margin="normal"
                value={formData.ConfirmPassword}
                onChange={handleChange}
                onFocus={resetSuccess}
                required 
            />
            <Button variant="contained" color="primary" style={{ display: 'block', margin: '20px auto 0' }} >Create</Button>
          </Box>
        </Grid>
        
        <Grid item xs={6} style={{ display: 'flex', justifyContent: 'center' }}>

          <Box width="75%">
            <TableContainer>
              <Table aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell>ID</TableCell>
                    <TableCell>Username</TableCell>
                    <TableCell align="center">Delete</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {/* Example Row */}
                  <TableRow>
                    <TableCell>1</TableCell>
                    <TableCell>admin1</TableCell>
                    <TableCell align="center">
                      <Button variant="contained" color="secondary">Delete</Button>
                    </TableCell>
                  </TableRow>
                  {/* More rows can be added here */}
                </TableBody>
              </Table>
            </TableContainer>
          </Box>
        </Grid>
      </Grid>
    </div>
  );
}

export default Create;
